package org.coding.leetcode.DailyContest;

public class Nov1 {
    //    https://leetcode.com/problems/delete-characters-to-make-fancy-string/description/?envType=daily-question&envId=2024-11-01
//    A fancy string is a string where no three consecutive characters are equal.
//
//Given a string s, delete the minimum possible number of characters from s to make it fancy.
//
//Return the final string after the deletion. It can be shown that the answer will always be unique.
//
//
//
//Example 1:
//
//Input: s = "leeetcode"
//Output: "leetcode"
//Explanation:
//Remove an 'e' from the first group of 'e's to create "leetcode".
//No three consecutive characters are equal, so return "leetcode".
//
//Example 2:
//
//Input: s = "aaabaaaa"
//Output: "aabaa"
//Explanation:
//Remove an 'a' from the first group of 'a's to create "aabaaaa".
//Remove two 'a's from the second group of 'a's to create "aabaa".
//No three consecutive characters are equal, so return "aabaa".
//
//Example 3:
//
//Input: s = "aab"
//Output: "aab"
//Explanation: No three consecutive characters are equal, so return "aab".
//
//
//
//Constraints:
//
//    1 <= s.length <= 105
//    s consists only of lowercase English letters.
    public static void main(String[] args) {
        System.out.println(makeFancyString1("leeetcodeeeeeeeeeeeeeeeeeeeeeedddddddddddddddddddddd"));
        System.out.println(makeFancyString1("leeetcode"));
        System.out.println(makeFancyString1("aab"));
//        System.out.println(makeFancyString(""));
    }

    // failed at ""
//    Time Limit Exceeded
    public static String makeFancyString(String s) {
        Integer counter = 0;
        for (int i = 0; i < s.length(); i++) {
            if (i + 2 < s.length() && s.charAt(i) == s.charAt(i + 1) && s.charAt(i) == s.charAt(i + 2)) {
                s = s.substring(0, i + 2) + s.substring(i + 3);
                i--;
            }
            counter++;
        }
        System.out.println(counter);
        return s;
    }

    public static String makeFancyString1(String s) {
        StringBuilder output = new StringBuilder();
        int tempCounter = 0;
        for (int i = 0; i < s.length(); i++) {
            if (i == s.length() - 1 || s.charAt(i) != s.charAt(i + 1)) {
                if (tempCounter < 2) {
                    output.append(s.charAt(i));
                }
                tempCounter = 0;
            } else {
                if (tempCounter < 2) {
                    output.append(s.charAt(i));
                }
                tempCounter++;
            }
        }
        return output.toString();
    }
}
